  \"Projection of global climate change scenarios onto the Hawaiian Islands: Estimating
  the characteristics of rainfall for the 21st century\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:48:49.876879\",\n\t\"name\": \"projection-of-global-climate-change-scenarios-onto-the-hawaiian-islands-estimating-the-cha\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This project will build on existing experience
  with statistical downscaling methods to derive comprehensive estimates of the future
  rainfall changes over the Hawaiian Islands for the mid and late 21st century (2046-2065
  and 2080-2100, respectively). Changes in the seasonal mean rainfall, daily variability,
  frequency of dry/wet spells, and the frequency of extreme events will be estimated.
  In close collaboration with ecosystem experts from the US Fish and Wildlife Service,
  USGS BRD, and the University of Hawaii we will adjust the statistical downscaling
  to provide optimized estimates for key climate targets that may have the highest
  risk potential for endangered species in Hawaii .\",\n\t\"license_title\": \"License
